import 'package:flutter/material.dart';
import 'package:firebase_core/firebase_core.dart';
import 'package:shared_preferences/shared_preferences.dart';
import 'package:cloud_firestore/cloud_firestore.dart';
import 'main_page.dart';
import 'sign_up.dart';
import 'onboarding.dart';
import 'view_ad.dart';


void main() async {
  WidgetsFlutterBinding.ensureInitialized();
  await Firebase.initializeApp();

  // Retrieve onboarding and login status
  final prefs = await SharedPreferences.getInstance();
  final bool userSeenOnboarding = prefs.getBool('seenOnboarding') ?? false;
  final bool isLoggedIn = prefs.getBool('isLoggedIn') ?? false;

  runApp(MyApp(
    userSeenOnboarding: userSeenOnboarding,
    isLoggedIn: isLoggedIn,
  ));
}

class MyApp extends StatelessWidget {
  final bool userSeenOnboarding;
  final bool isLoggedIn;

  const MyApp({
    Key? key,
    required this.userSeenOnboarding,
    required this.isLoggedIn,
  }) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      title: 'Lost Buoy',
      theme: ThemeData(
        primarySwatch: Colors.indigo,
        visualDensity: VisualDensity.adaptivePlatformDensity,
      ),
      /*home: userSeenOnboarding
          ? (isLoggedIn ? const MainPage() : SignUpPage())
          : const OnboardingScreen(),*/
      home: ViewAdPage(
        adData: {
          'title': 'cleanser',
          'description': 'tertinggal atas sinki tandas sutera aras 2 wing sekolah',
          'postType': 'Found',
          'createdAt': Timestamp.fromDate(DateTime(2024, 12, 26, 1, 4, 20)),
          'location': GeoPoint(5.260270454452362, 103.16619493067265),
          'imageBase64': '',
          'createdBy': 'd70tHsRtmfNtmsqQvZU5vVlinjD3',
        },
      ),

    );
  }
}
